INSERT INTO `logement` (`idLogement`, `Ville`, `Taille`, `Type`, `AnneeDeCreation`, `Adresse`, `Photo`, `Description`) VALUES
(25, 'Nantes', 435, 'Maison', '2019-12-04', '8 avenue du sapin', , 'J’habite une petite maison en banlieue parisienne, la banlieue parisienne signifie près de Paris, ma maison est dans la banlieue de Paris, elle est près de Paris. C’est une maison avec un étage. Au rez-de-chaussée, il y a une chambre, une cuisine, une salle de bains, un salon et une salle à manger. Dans la chambre, il  y a un lit, un radiateur, une table de nuit, un placard, un bureau et une chaise.');
INSERT INTO `logement` (`idLogement`, `Ville`, `Taille`, `Type`, `AnneeDeCreation`, `Adresse`, `Photo`, `Description`) VALUES
(26, 'Lyon', 951, 'Maison', '2019-12-21', '9 rue du lapin', , 'Le bureau est grand, il a 4 tiroirs. Dans les tiroirs, je range mes fournitures de bureau, c’est-à-dire des ciseaux, des crayons, des stylos, une règle, du scotch, une agrafeuse, un taille-crayon et une gomme. C’est une chambre avec de la moquette. Il n’y a rien sur les murs. Les murs sont blancs. Sur la table de nuit, il y a une lampe de chevet et un réveil.');
INSERT INTO `logement` (`idLogement`, `Ville`, `Taille`, `Type`, `AnneeDeCreation`, `Adresse`, `Photo`, `Description`) VALUES
(27, 'Berck', 80, 'Appartement', '2019-12-19', '14 bis grand rue', , 'La salle de bains est grande, il y a une baignoire. C’est une baignoire qui permet de prendre aussi une douche grâce au rideau de douche. Dans la salle de bains, il y a également un lavabo et la machine à laver. En général, je mets le linge sale dans une corbeille qui est à côté de la machine.');
INSERT INTO `logement` (`idLogement`, `Ville`, `Taille`, `Type`, `AnneeDeCreation`, `Adresse`, `Photo`, `Description`) VALUES
(28, 'Chartres', 14, 'Appartement', '2019-12-12', '23 rue de la dame blanche', , 'Dans la cuisine, il y a une table, des chaises, des plaques chauffantes, un four micro ondes, une machine à café, un grand placard et aussi un réfrigérateur qui fait aussi congélateur. Dans le placard, je range la vaisselle : les assiettes, les verres, les couverts (les couteaux, les fourchettes, les cuillères à soupe, les cuillères à café) les tasses, les bols, les serviettes. Il ne faut pas confondre les torchons et les serviettes, les serviettes servent à s’essuyer la bouche alors que les torchons servent à essuyer la vaisselle. Je n’ai pas de lave vaisselle. Je lave la vaisselle dans l’évier avec une éponge et du produit vaisselle.');

